import './Middle.css';
import React, { Component } from 'react';

class Middle extends Component {
    constructor(props) {
      super(props);
      this.state = 
        {
          count: null,
          o1:null,
          o2:null
        };
      
      this.fetchAdd = this.fetchAdd.bind(this);
    }
  

    fetchAdd() {
    let testURL = 'http://localhost:8080/hcl/add/'+this.state.o1+'/'+this.state.o2;
    console.log("testURL", testURL);

    const myInit = {
		  method: 'GET',
        mode: 'no-cors',
        headers: {
        }
	  };

    const myRequest = new Request(testURL, myInit);
        fetch(myRequest)
          .then( (response) => {
            console.log("response", response);
            this.setState({
              count: response.count
            });
            console.log("count", this.state.count)
          })
          .catch( (error) => {
            console.log(error)
          });
        
    }
 
    myChangeHandlero1 = (event) => {
      this.setState({o1: event.target.value});
      console.log('o1='+this.state.o1)
    }
    myChangeHandlero2 = (event) => {
      this.setState({o2: event.target.value});
      console.log('o2='+this.state.o2)
    }
render() {
   
    return (
      <div>
        <p>add  <input type='text' onChange={this.myChangeHandlero1} /> to 
        <input type='text' onChange={this.myChangeHandlero2} /> = {this.fetchAdd.count}</p>
        <button onClick={this.fetchAdd}>
          Click me
        </button>
      </div>
    );
  }
}
  export default Middle;
